import React, { useState, useEffect } from 'react';

const Tarjetas = () => {
  const [deporte, setDeporte] = useState('');
  const [descripcion, setDescripcion] = useState('');
  const [entrenadores, setEntrenadores] = useState([]);
  const [entrenadorId, setEntrenadorId] = useState('');
  const [categoria, setCategoria] = useState('8-10');
  const [ubicacion, setUbicacion] = useState('');
  const [horario, setHorario] = useState('8-12');
  const [message, setMessage] = useState('');

  // Obtener los entrenadores al cargar la pÃ¡gina
  useEffect(() => {
    const fetchEntrenadores = async () => {
      try {
        const response = await fetch('http://localhost:5000/entrenadores');
        const data = await response.json();
        setEntrenadores(data);
        setEntrenadorId(data[0]?.user_id || ''); // Selecciona el primer entrenador por defecto
      } catch (error) {
        console.error('Error al obtener entrenadores:', error);
      }
    };
    fetchEntrenadores();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch('http://localhost:5000/tarjetas', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          deporte,
          descripcion,
          entrenador_id: entrenadorId,
          categoria,
          ubicacion,
          horario
        })
      });

      const data = await response.json();

      if (response.ok) {
        setMessage('Tarjeta creada correctamente');
        // Resetear el formulario
        setDeporte('');
        setDescripcion('');
        setUbicacion('');
        setHorario('8-12');
        setCategoria('8-10');
        setEntrenadorId(entrenadores[0]?.user_id || '');
      } else {
        setMessage(data.message);
      }
    } catch (error) {
      setMessage('Error al crear la tarjeta');
    }
  };

  return (
    <div>
      <h1>Crear Tarjeta</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Deporte:</label>
          <input
            type="text"
            value={deporte}
            onChange={(e) => setDeporte(e.target.value)}
            required
          />
        </div>
        <div>
          <label>DescripciÃ³n:</label>
          <input
            type="text"
            value={descripcion}
            onChange={(e) => setDescripcion(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Entrenador:</label>
          <select value={entrenadorId} onChange={(e) => setEntrenadorId(e.target.value)} required>
            {entrenadores.map((entrenador) => (
              <option key={entrenador.user_id} value={entrenador.user_id}>
                {entrenador.username}
              </option>
            ))}
          </select>
        </div>
        <div>
          <label>CategorÃ­a:</label>
          <select value={categoria} onChange={(e) => setCategoria(e.target.value)} required>
            <option value="8-10">8-10</option>
            <option value="9-12">9-12</option>
            <option value="13-16">13-16</option>
            <option value="17+">17+</option>
          </select>
        </div>
        <div>
          <label>UbicaciÃ³n:</label>
          <input
            type="text"
            value={ubicacion}
            onChange={(e) => setUbicacion(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Horario:</label>
          <select value={horario} onChange={(e) => setHorario(e.target.value)} required>
            <option value="8-12">8-12</option>
            <option value="3-6">3-6</option>
          </select>
        </div>
        <button type="submit">Crear Tarjeta</button>
      </form>
      {message && <p>{message}</p>}
    </div>
  );
};

export default Tarjetas;
